import "../../css/command.css";
import useIpAddress from "../../hooks/useIpAddress";

const Whoami = () => {
  const { ip } = useIpAddress();
  return (
    <div>
      <p>Whoami</p>
      <p>{ip}</p>
    </div>
  );
};

export default Whoami;
